pragma solidity ^0.8.0;

contract TradingContract {
    address public owner;
    bool public tradingOpen = false;
    address public constant UNISWAP_ROUTER = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D; // Uniswap V2 Router address
    uint256 public constant MAX_APPROVAL = 10**6 * 10**18; // Example max approval value

    event TradingOpened();
    event Approval(address indexed owner, address indexed spender, uint256 value);

    modifier onlyOwner() {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function openTrading() external onlyOwner {
        require(!tradingOpen, "Trading is already open");

        // Approve the Uniswap Router to spend tokens on behalf of this contract
        _approve(address(this), UNISWAP_ROUTER, MAX_APPROVAL);

        // Emit an event to indicate trading is open
        tradingOpen = true;
        emit TradingOpened();
    }

    function _approve(
        address ownerAddress,
        address spender,
        uint256 amount
    ) internal {
        require(ownerAddress != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        // Logic to approve the spender (e.g., Uniswap Router) to spend tokens
        emit Approval(ownerAddress, spender, amount);
    }
}
